\documentclass[tikz,border=10pt]{standalone}
    \usepackage{tikz}
    \usetikzlibrary{arrows.meta, positioning, shapes.geometric}

    \begin{document}
    \begin{tikzpicture}[node distance=1.5cm]
    \tikzstyle{input} = [ellipse, draw, minimum width=2.5cm, minimum height=1cm]
    \tikzstyle{process} = [rectangle, draw, minimum width=3cm, minimum height=1cm]
    \tikzstyle{decision} = [diamond, draw, aspect=2, minimum width=3cm, minimum height=1cm]
    \tikzstyle{output} = [ellipse, draw, minimum width=2.5cm, minimum height=1cm]
    \tikzstyle{block} = [rectangle, draw, fill=gray!20, minimum width=4cm, minimum height=1cm]

    \node (input) [input] {Input};
    \node (init) [process, below of=input] {Initialization};
    \node (grid) [process, below of=init] {Grid variation};

    \node (computation) [block, below of=grid, yshift=-0.5cm] {Computation};
    \node (feasibleOp) [process, below of=computation, yshift=-0.5cm] {Generation of Feasible Operation Region};
    \node (feasiblePlan) [process, below of=feasibleOp] {Generation of Feasible Planning Region};

    \node (decision) [decision, below of=feasiblePlan, yshift=-0.5cm] {Additional Grid?};
    \node (outputFalse) [output, below of=decision, xshift=-2cm] {Output: False};
    \node (loop) [process, below of=decision, xshift=2cm] {Grid variation};

    \draw[->] (input) -- (init);
    \draw[->] (init) -- (grid);
    \draw[->] (grid) -- (feasibleOp);
    \draw[->] (feasibleOp) -- (feasiblePlan);
    \draw[->] (feasiblePlan) -- (decision);
    \draw[->] (decision) -- node[right] {Yes} (loop);
    \draw[->] (decision) -- node[left] {No} (outputFalse);
\end{tikzpicture}
    \end{document}

