    \node (sat) [draw, rectangle, below=of driver] {SAT instances};
    \node (partial) [draw, rectangle, right=of sat] {Partial assignment};
    \node (fourier) [draw, rectangle, right=of partial] {Fourier transform};
    \node (conflict) [draw, rectangle, below=of fourier] {Conflict clause};
    \node (solver) [draw, rectangle, right=of conflict] {Programmatic SAT solver};
    \node (enumeration) [draw, rectangle, below=of solver] {Enumeration in order n};

    % Define connections
    \draw[->] (diophantine) -- (driver);
    \draw[->] (driver) -- (sat);
