    \draw[->] (partial) -- (fourier);
    \draw[->] (fourier) -- (conflict);
    \draw[->] (conflict) -- (solver);
    \draw[->] (solver) -- (enumeration);

    % Add result connection
    \draw[->] (driver.south) -- ++(0,-0.5) node[midway, left] {Result} -- ++(0,-1) -- ++(-1,0) |- (driver.south);
